"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Bonadonna G, Valagussa P, and Santoro A, &ldquo;Alternating Non-Cross-Resistant Combination Chemotherapy or MOPP in Stage IV Hodgkin's Disease. A Report of 8-Year Results,&rdquo;",
"      <i>",
"       Ann Intern Med",
"      </i>",
"      , 1986, 104(6):739-46.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?39/57/40853/abstract-text/2422994/pubmed\" id=\"2422994\" target=\"_blank\">",
"        2422994",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
