var title_f39_57_40856="ECG Accelerated idioventricular rhythm tutorial";
var content_f39_57_40856=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52385&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52385&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1105px;\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    Single lead electrocardiogram (ECG) showing accelerated idioventricular rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 159px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An accelerated ventricular rhythm occurs in this case at a rate of 70 beats/minute. The P waves are dissociated from the QRS complexes and occur at rate which is slower than the RR interval.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
