var title_f39_57_40860="Mechanical versus functional intestinal obstruction";
var content_f39_57_40860=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F84010&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F84010&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Main differences between mechanical versus functional intestinal obstruction",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"20%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mechanical obstruction",
"       </td>",
"       <td class=\"subtitle1\">",
"        POI",
"       </td>",
"       <td class=\"subtitle1\">",
"        AIPO/ACPO",
"       </td>",
"       <td class=\"subtitle1\">",
"        CIPO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Luminal obstruction",
"        </strong>",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Motility",
"        </strong>",
"       </td>",
"       <td>",
"        Initially &uarr; then &darr; proximal to obstruction",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;/uncoordinated",
"       </td>",
"       <td>",
"        &darr;/uncoordinated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Dilatation",
"        </strong>",
"       </td>",
"       <td>",
"        Yes (proximal to obstruction)",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         GI involvement",
"        </strong>",
"       </td>",
"       <td>",
"        Proximal to obstruction",
"       </td>",
"       <td>",
"        Mainly small bowel",
"       </td>",
"       <td>",
"        Mainly colon",
"       </td>",
"       <td>",
"        Pan-enteric",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Radiology",
"        </strong>",
"       </td>",
"       <td>",
"        Typical \"cut-off\" point; presence of air-fluid levels",
"       </td>",
"       <td>",
"        \"Cut-off point\" occasionally present; air-fluid levels usually absent",
"       </td>",
"       <td>",
"        \"Cut-off point\" occasionally present; air-fluid levels sometimes detected",
"       </td>",
"       <td>",
"        \"Cut-off point\" occasionally present; air-fluid levels detectable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Course",
"        </strong>",
"       </td>",
"       <td>",
"        Acute",
"       </td>",
"       <td>",
"        Acute",
"       </td>",
"       <td>",
"        Acute",
"       </td>",
"       <td>",
"        Chronic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Progression",
"        </strong>",
"       </td>",
"       <td>",
"        Rapidly evolving toward total obstruction",
"       </td>",
"       <td>",
"        Self-limiting, slowly improving",
"       </td>",
"       <td>",
"        May respond to medical treatment; major complication may occur",
"       </td>",
"       <td>",
"        Variable, generally self- limiting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Treatment",
"        </strong>",
"       </td>",
"       <td>",
"        Surgery",
"       </td>",
"       <td>",
"        Supportive measures",
"       </td>",
"       <td>",
"        Medical treatment (neostigmine); decompressive endoscopy or surgery in unresponsive cases",
"       </td>",
"       <td>",
"        Variable; EN, TPN/HPN often needed",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     &uarr;: increased; &darr;: decreased; AIPO/ACPO: acute intestinal pseudo-obstruction/acute colonic pseudo-obstruction; CIPO: chronic intestinal pseudo-obstruction; EN: enteral nutrition; GI: gastrointestinal; POI: postoperative ileus; TPN/HPN: total/home parenteral nutrition.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: De Giorgio R, Cogliandro RF, Barbara G, et al. Chronic intestinal pseudo-obstruction: clinical features, diagnosis, and therapy. Gastroenterol Clin North Am 2011; 40:787. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
