var title_f39_57_40862="Tender points fibro PI";
var content_f39_57_40862=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F53200&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F53200&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Tender points in fibromyalgia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 199px; height: 281px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    People with fibromyalgia usually have many \"tender points\" on their body that hurt when touched or pressed on. These tender points are bilateral, meaning that they are the same on both the left and right side of the body. Most people with fibromyalgia have tenderness on at least 11 of the 18 points shown in this picture. They usually have also had pain throughout the body for at least three months.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Goldenberg, DL, Hosp Pract (Off Ed) 1989; 24:39.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
